import './App.css';
import Board from './components/Board'
import QueueProvider from './context/Queue';
import { AudioPlayerProvider, useAudioPlayer } from './context/playMusic';

function App() {
  const { audioPath, setAudioPath, playAudio } = useAudioPlayer();
  const audioFilePath = '/elevatorSound.mp3';
  return (
    <AudioPlayerProvider path={audioFilePath}>
      <div className='exercise-container'>
        <h1 className='exercise-header'>Elevator Exercise</h1>
      <QueueProvider>
        <Board rows={10} columns={10} />
      </QueueProvider>
    </div>
  </AudioPlayerProvider>
  );
}

export default App;
